CREATE TABLE "public"."country" ( 
	"id" BIGSERIAL NOT NULL,
	"iso" Character( 2 ) COLLATE "pg_catalog"."default" NOT NULL,
	"name" Character Varying( 80 ) COLLATE "pg_catalog"."default" NOT NULL,
	"nicename" Character Varying( 80 ) COLLATE "pg_catalog"."default" NOT NULL,
	"iso3" Character( 3 ) COLLATE "pg_catalog"."default",
	"numcode" SmallInt,
	"phonecode" Integer NOT NULL,
	"fk_currency_sign" Bigint,
	PRIMARY KEY ( "id" ),
	CONSTRAINT "country_unique_id" UNIQUE( "id" ) );
 ;
 
